import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes"

function createNotes(notes){
  return <Note
    title={notes.title}
    content={notes.content}
  />
}

function App(props) {
  return (
    <div>
      <Header />
      <Note 

      />
      <Footer />
    </div>
  );
}

export default App;
